import React, { Component } from 'react'
import './style/App.css'
import 'antd/dist/antd.css'
import {
  Button,
  Input
} from 'antd'

class App extends Component {
  render() {
    return (
      <div>
        <Input className = '_input' placeholder="Basic usage" size = 'small' />
        <Button />
      </div>
    )
  }
}

export default App
